import "./Shipping.css";
import { React, Component } from "react";

class Shipping extends Component{
    render(){
        return(
            <div className="Shipping"> 
                <p>Free Shipping on ordes $50.00 or more.</p>
            </div>
        )
    }
}

export default Shipping;
